tests.code:
cy.visit(`${input.url}`);
cy.wait(10000);
cy.scrollTo("top");
_amazonSearchPage.default.typeKeyword(`${input.typeKeyword}`);
cy.wait(1000);
_amazonSortProductPage.default.selectPriceDesc();
cy.wait(3000);
_amazonProductPage.default.getTotalData().then($val => {
  totalData = $val.length;
  cy.log(`Banyaknya data = ${totalData}`);
});
_amazonProductPage.default.getNamaBarang().then(data => {
  nmBarang = data;
  cy.log(`Nama Barang = ${nmBarang}`);
});
_amazonProductPage.default.getHargaBarang().then(data => {
  hrgBarang = data;
  cy.log(`Harga Barang = ${hrgBarang}`);
});
_amazonProductPage.default.clickBarang();
_amazonHomePage.default.checkNamaBarang().then(data => {
  expect(data.trim()).equal(nmBarang);
});
_amazonHomePage.default.checkHrgBarang().then(data => {
  expect(data.trim()).equal(hrgBarang);
});
